import React from 'react';
import './Login.css';  // CSS 파일 로드

function Login() {
    return (
        <div className="loginPage">
            <img src="main.png" alt="Main" className="mainImage" />
            {/* 로그인 폼 또는 추가적인 컨텐츠를 여기에 배치 */}
        </div>
    );
}

export default Login;
